import React from "react";
import { useAuth } from "../context/AuthContext";

function Dashboard() {
  const { user } = useAuth();
  const username = user?.username || "there";

  return (
    <div className="dashboard-container">
      
      <p>Manage your SOC operations efficiently.</p>
    </div>
  );
}

export default Dashboard;
